import MainConteiner from './../components/main';
import SliderNews from './../components/news/sliderNews';
import NewsList from './../components/news/newsList';
import './../styles/news.css';

export default class News extends Component{
    
    static async getInitialProps(ctx) {
        const urlApi = `https://cosmere-latam.000webhostapp.com/app/index.php?f=newsListAll&sec=all&page=5`;
        const res = await fetch(urlApi);
        console.log(ir)
        const json = await res.json();
        return { stars: json }
    }

    constructor(props) {
        super(props);
        this.state = {
            section: 'all',
            page: 5,
            Result : [],
            isLoading : true
        };
    }

    render(){
        return(
            <MainConteiner>
                <section className="news">
                    <SliderNews></SliderNews>
                    <NewsList
                        list = {this.this.props.stars}
                    />
                </section>
            </MainConteiner>
        );
    }
}
